import React from 'react';
import './App.css';
import {Routes} from 'react-router'
import routes from './routes';
import PrivateRoutes from './routes/privateRoutes';

function App () {
    return (
        <div className="App">
            { routes.map(route => {
                if (route.requireAuth) {
                    return <PrivateRoutes path={ route.path } component={ route.component } accessLevel={route.accessLevel}/>;
                }
                return
            }) }
        </div>
    );
}

export default App;
